import React from 'react'
import { Link } from 'react-router-dom'

let block_len = 0

const Sidebar = (props) => {

    const linkBuilder = async (props) => {
        var output = "<React.Fragment>";
        const path = props.input.links
        const num_links =Object.keys(path).length
        for (var i = 1; i < num_links; i++){
            const param = ".link" + i;
            const temp_link = props.input.links + param;
            const temp_link_title = temp_link + ".title";
            const temp_link_link = temp_link + ".link";
            const temp_link_heading = temp_link + ".heading"
            const line1_out = "<h1 style={test}>{" + temp_link_title + "}</h1>"
            const line2_out = "<Link to={" + temp_link_link + "} style={link_style}>" + temp_link_heading + "</Link>"
            output = output + line1_out + line2_out
        }
        output = output + "</React.Fragment>"
        return output
    }

    const input = linkBuilder(props)
    console.log(input)


    if(props.input.blank === false){

    }
    const block = props.input.blocks
    try {
        block_len = Object.keys(block).length
    } catch (error) {
        console.log(error)
    }

    return(
        <div className="sidebar_div">
            {props.input.blank === false && 
            <React.Fragment>
                <div style={props.input.marginTop}></div>
                {block_len === 1 &&
                <React.Fragment>
                <h1 style={test}>{props.input.blocks.link1.title}</h1>
                <Link to={props.input.blocks.link1.link} style={link_style}>Create Movie</Link>
                </React.Fragment>
                }
                {block_len === 2 &&
                    <React.Fragment>
                     <h1 style={test}>{props.input.blocks.link1.title}</h1>
                    <Link to={props.input.blocks.link1.link} style={link_style}>Create Movie</Link>
                    <h1 style={test}>{props.input.blocks.link2.title}</h1>
                    <Link to={props.input.blocks.link2.link} style={link_style}>View Movie</Link>
                    </React.Fragment>
                }
                {block_len === 3 &&
                    <React.Fragment>
                     <h1 style={test}>{props.input.blocks.link1.title}</h1>
                    <Link to={props.input.blocks.link1.link} style={link_style}>{props.input.blocks.link1.title}</Link>
                    <h1 style={test}>{props.input.blocks.link2.title}</h1>
                    <Link to={props.input.blocks.link2.link} style={link_style}>{props.input.blocks.link2.title}</Link>
                    <h1 style={test}>{props.input.blocks.link3.title}</h1>
                    <Link to={props.input.blocks.link3.link} style={link_style}>{props.input.blocks.link3.title}</Link>
                    </React.Fragment>
                }
                {block_len === 4 &&
                    <React.Fragment>
                     <h1 style={test}>{props.input.blocks.item1.title}</h1>
                    <Link to={props.input.blocks.link1.link} style={link_style}>{props.input.blocks.link1.title}</Link>
                    <h1 style={test}>{props.input.blocks.link2.title}</h1>
                    <Link to={props.input.blocks.link2.link} style={link_style}>{props.input.blocks.link2.title}</Link>
                    <h1 style={test}>{props.input.blocks.link3.title}</h1>
                    <Link to={props.input.blocks.link3.link} style={link_style}>{props.input.blocks.link3.title}</Link>
                    <h1 style={test}>{props.input.blocks.link4.title}</h1>
                    <Link to={props.input.blocks.link4.link} style={link_style}>{props.input.blocks.link4.title}</Link>
                    </React.Fragment>
                }
            </React.Fragment>
            }
        </div>
    );
}

const test = {
    color: "white",
    textAlign: "center"
}

const link_style = {
    fontSize: "20pt",
    fontWeight: "bold",
    marginLeft: "10%"
}

export default Sidebar
